import React from 'react';
import{
	Link
}from 'react-router-dom';


function Header() {
  return (
<header>
<div className="logo">
Logo
</div>

<nav>
<ul>
<li>
<Link to="/">Home</Link>
</li>
<li>
<Link to="/Blog">Blog</Link>
</li>
</ul>
</nav>
</header>
  );
}

export default Header;
